import { Route, Routes } from "react-router-dom";
import Header from "./Componatns/Header/Header";
import SidBar from "./Componatns/SideBar/SiderBar";

export default function App(){
return(
<div>
<Header/>
<SidBar />

<Routes>
    <Route path="/" element={<Home/>}></Route>
</Routes>



</div>
)
}
